    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        foreach ($this->designs as $design) {
            if ($design['name'] !=='') {
                $design['name'] = $this->cleanNameEnd(trim(strtolower($design['name'])));
                $design['active'] = true;
                $design['ink_level_id'] = $this->ink[$design['ink_level_id']];
                $design['color_id'] = $this->colors[$design['color_code']];
                unset($design['color_code']);
                $design['genre_id'] = $this->genres[$design['genre_id']];
                DB::table('designs')->insert($design);
            }
        }
    }

    private function cleanNameEnd($name)
    {
        $cleanables = ['polera', 'negra', 'blanca', 'azul marino', 'gris', 'verde', 'amarilla', 'arena', 'verde militar', 'celeste', 'azul'];
        while (true) {
            $lastSpace = strrpos($name, " ");
            $lastWord = substr($name, $lastSpace + 1);
            if (in_array(trim($lastWord), $cleanables)) {
                $name = trim(substr($name, 0, $lastSpace));
            } else {
                break;
            }
        }
        return $name;
    }

